        this.inputs_items = [];

        // Start of HEAP index
        this.audio_heap_ptr = 0;

        // Setup pointers offset
        this.audio_heap_ptr_inputs = this.audio_heap_ptr;
        this.audio_heap_ptr_outputs = this.audio_heap_ptr_inputs + (this.numIn * this.ptr_size);
